const actions = {
    GET_REPOSITORIES: 'GET_REPOSITORIES',
    GET_ALL_CONTRIBUTORS:'GET_ALL_CONTRIBUTORS',
  
    getRepositoryData: data => {
      return {
        type: actions.GET_REPOSITORIES,
        data,
      };
    },
    getContributorsData: data => {
      return {
        type: actions.GET_ALL_CONTRIBUTORS,
        data,
      };
    },
   
  };
  
  export default actions;
